 delete from md_db_relation where startattrid in ( select id from md_property where classid in ( '1a8eb8f6-fe5b-4352-ae85-a11b3b3f512a', '@@@@' ) and ( versiontype = 0 or versiontype is null ) ) and starttableid in ( 'sys_dictionary', '@@@@' );
 delete from md_ormap where ATTRIBUTEID in ( select id from md_property where classid in ( '1a8eb8f6-fe5b-4352-ae85-a11b3b3f512a', '@@@@' ) and ( versiontype = 0 or versiontype is null ) ) and tableid in ( 'sys_dictionary', '@@@@' );
 delete from md_table where id not in ( select distinct tableid from md_ormap ) and ( versiontype = 0 or versiontype is null );
 delete from md_column where tableid in ( 'sys_dictionary', '@@@@' ) and id not in ( select distinct columnid from md_ormap ) and ( ifnull( groupid, '~' ) = '~' or groupid = id ) and name <> 'extend_bean_tag';
 delete from md_column where tableid in ( 'sys_dictionary', '@@@@' ) and groupid is not null and groupid not in ( select distinct t.id from ( select * from md_column ) t where tableid in ( 'sys_dictionary', '@@@@' ) );
 delete from md_db_relation where starttableid not in ( select id from md_table );
