 delete from md_accessorpara where id in ( select distinct id from md_class where componentID = 'ae9cf26a-0aab-49d6-ab9c-b09bc078ec7a' );
 delete from md_enumvalue where id in ( select distinct id from md_class where componentID = 'ae9cf26a-0aab-49d6-ab9c-b09bc078ec7a' ) and ( versiontype = 0 or versiontype is null );
 delete from md_class where componentID = 'ae9cf26a-0aab-49d6-ab9c-b09bc078ec7a' and ( versiontype = 0 or versiontype is null );
 delete from md_component where id = 'ae9cf26a-0aab-49d6-ab9c-b09bc078ec7a' and ( versiontype = 0 or versiontype is null );
